import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = ({ data }) => {
  return (
    <div className="tile-list">
      {data.map((item, index) => (
        <div key={index} className="tile">
          <Tile name={item.name} phone={item.phone} email={item.email} />
        </div>
      ))}
    </div>
  );
};
